import React, { Component } from 'react';
import Header from './header';
import Menu from './menu';
import KhuNha from './khuNha/khuNha';
import ThemKhuNha from './khuNha/themKhuNha';

export default class AdminHome extends Component {
    render() {
        return (
            <div>
                <Header />
                <div className="row">
                    <Menu />

                    <div className="col-md-9">
                        <div className="row">
                            <KhuNha tenKhuNha="Khu A"/>
                            <KhuNha tenKhuNha="Khu B"/>
                            <KhuNha tenKhuNha="Khu C"/>
                            <KhuNha tenKhuNha="Khu F"/>
                            <KhuNha tenKhuNha="Khu G"/>
                            <KhuNha tenKhuNha="Khu H"/>
                            <KhuNha tenKhuNha="Khu I"/>
                            <ThemKhuNha />
                        </div>
                    </div>
                </div>
            </div>   
        );
    }
}
